#!/bin/bash

# Start OBS recording
/usr/local/bin/obs-cmd toggle-mute Mic/Aux

tell application "Adobe Photoshop 2025"
	if (count of documents) is 0 then
		display dialog "No document is open in Photoshop." buttons {"OK"} default button 1
		return
	end if

	-- Prompt user for export location
	set exportPath to choose folder with prompt "Choose a folder to export PNG:"
	set exportFileName to name of current document
	set AppleScript's text item delimiters to "."
	set exportFileName to text item 1 of exportFileName & ".png"
	set fullPath to POSIX path of exportPath & exportFileName

	-- Run JavaScript inside Photoshop to perform PNG export
	do javascript "
		var doc = app.activeDocument;
		var opts = new ExportOptionsSaveForWeb();
		opts.format = SaveDocumentType.PNG;
		opts.PNG8 = false;
		opts.transparency = true;
		opts.interlaced = false;
		opts.quality = 100;
		var file = new File('" & fullPath & "');
		doc.exportDocument(file, ExportType.SAVEFORWEB, opts);
	"
end tell

tell application "Adobe Photoshop 2025"
	if (count of documents) is 0 then
		display dialog "No document is open in Photoshop." buttons {"OK"} default button 1
		return
	end if

	-- Prompt user for export location
	set exportPath to choose folder with prompt "Choose a folder to export JPEG:"
	set exportFileName to name of current document
	set AppleScript's text item delimiters to "."
	set exportFileName to text item 1 of exportFileName & ".jpg"
	set fullPath to POSIX path of exportPath & exportFileName

	-- Run JavaScript inside Photoshop to perform JPEG export
	do javascript "
		var doc = app.activeDocument;
		var opts = new ExportOptionsSaveForWeb();
		opts.format = SaveDocumentType.JPEG;
		opts.includeProfile = false;
		opts.interlaced = false;
		opts.optimized = true;
		opts.quality = 80; // JPEG quality from 0 to 100
		var file = new File('" & fullPath & "');
		doc.exportDocument(file, ExportType.SAVEFORWEB, opts);
	"
end tell

-- Prompt for folder
set folderPath to POSIX path of (choose folder with prompt "Choose folder with images to export as PDF:")

-- JavaScript with proper escaping
set jsScript to "
var folder = new Folder('" & folderPath & "');
if (!folder.exists) {
    alert('Folder not found!');
} else {
    var pdfFolder = new Folder(folder.fsName + '/PDFs');
    if (!pdfFolder.exists) pdfFolder.create();

    var files = folder.getFiles(function(f) {
        return f instanceof File && /\\.(jpe?g|png)$/i.test(f.name);
    });

    for (var i = 0; i < files.length; i++) {
        var file = files[i];
        open(file);
        var doc = app.activeDocument;

        var pdfSaveOptions = new PDFSaveOptions();
        pdfSaveOptions.pDFPreset = 'High Quality Print';

        var baseName = file.name.replace(/\\.[^\\.]+$/, '');
        var saveFile = new File(pdfFolder.fsName + '/' + baseName + '.pdf');

        doc.saveAs(saveFile, pdfSaveOptions, true);
        doc.close(SaveOptions.DONOTSAVECHANGES);
    }

    alert('PDFs saved in: ' + pdfFolder.fsName);
}
"

-- Run script in Photoshop
tell application "Adobe Photoshop 2025"
    do javascript jsScript
end tell

set targetWidth to 200
set targetHeight to 200

-- Prompt the user to choose a folder
set folderPath to POSIX path of (choose folder with prompt "Choose folder with images to resize:")

-- Escape single backslashes and quotes
set jsScript to "
var folder = new Folder('" & folderPath & "');
if (!folder.exists) {
    alert('Folder not found!');
} else {
    var files = folder.getFiles(function(f) {
        return f instanceof File && /\\.(jpe?g|png)$/i.test(f.name);
    });

    for (var i = 0; i < files.length; i++) {
        var file = files[i];
        open(file);
        var doc = app.activeDocument;

        doc.resizeImage(UnitValue(" & targetWidth & ", 'px'), UnitValue(" & targetHeight & ", 'px'), null, ResampleMethod.BICUBIC);

        var saveFile = new File(file.fsName);
        var opts;

        if (/\\.jpe?g$/i.test(file.name)) {
            opts = new JPEGSaveOptions();
            opts.quality = 12;
            doc.saveAs(saveFile, opts, true);
        } else if (/\\.png$/i.test(file.name)) {
            opts = new PNGSaveOptions();
            doc.saveAs(saveFile, opts, true);
        }

        doc.close(SaveOptions.DONOTSAVECHANGES);
    }

    alert('All images resized to " & targetWidth & "x" & targetHeight & "px.');
}
"

-- Run JavaScript in Photoshop
tell application "Adobe Photoshop 2025"
    do javascript jsScript
end tell
